import React, {useEffect, useState} from "react";

function App() {
    const [data, setData] = useState();

    useEffect(() => {
        fetch('/api')
            .then(res =>
                res.json()
            )
            .then(data =>
                setData(data)
            )
    }, [])

    return (
      <>
        <h1> Hello World </h1>
      </>
    )
}

export default App;
